import React from 'react';
import './App.css';


fetch("https://jsonplaceholder.typicode.com/todos/1")
  .then((response) => {
    return response.json()
  })
  .then((result) => {
    console.log(result);
  })

function App() {

  return(
    <div className="App-header">
      <h1>Notre dernier article</h1>
    </div>
  )
}

export default App;
